You can't do this: # struct BirthdayCard {}
impl BirthdayCard { fn new(name: &str) -> Self {
# Self{} // ... } // Can't add more overloads: // // fn new(name: &str, age: i32) -> BirthdayCard { ... } // // fn new(name: &str, text: &str) -> BirthdayCard { ... }
} If you have a default constructor, and a few variants for other cases, you can simply write them as different static methods. An idiomatic way to do this is to write a new() constructor and then with_foo() constructors that apply the given "foo" when constructing. # struct Racoon {}
impl Racoon { fn new() -> Self {
# Self{} // ... } fn with_age(age: usize) -> Self {
# Self{} // ... }
} If you have have a bunch of constructors and no default, it may make sense to instead provide a set of new_foo() constructors. # struct Animal {}
impl Animal { fn new_squirrel() -> Self {
# Self{} // ... } fn new_badger() -> Self {
# Self{} // ... }
} For a more complex situation, you may use the builder pattern . The builder has a set of methods which take &mut self and return &mut Self. Then add a build() that returns the final constructed object. struct BirthdayCard {} struct BirthdayCardBuilder {}
impl BirthdayCardBuilder { fn new(name: &str) -> Self {
# Self{} // ... } fn age(&mut self, age: i32) -> &mut Self {
# self // ... } fn text(&mut self, text: &str) -> &mut Self {
# self // ... } fn build(&mut self) -> BirthdayCard { BirthdayCard { /* ... */ } }
} You can then chain these into short or long constructions, passing parameters as necessary: # struct BirthdayCard {}
#
# struct BirthdayCardBuilder {}
# impl BirthdayCardBuilder {
# fn new(name: &str) -> BirthdayCardBuilder {
# Self{}
# // ...
# }
#
# fn age(&mut self, age: i32) -> &mut BirthdayCardBuilder {
# self
# // ...
# }
#
# fn text(&mut self, text: &str) -> &mut BirthdayCardBuilder {
# self
# // ...
# }
#
# fn build(&mut self) -> BirthdayCard { BirthdayCard { /* ... */ } }
# }
#
fn main() { let card = BirthdayCardBuilder::new("Paul") .age(64) .text("Happy Valentine's Day!") .build();
} Note another advantage of builders: Overloaded constructors often don't provide all possible combinations of parameters, whereas with the builder pattern, you can combine exactly the parameters you want.

