It's common in C++ to have a class that contain mutable references to other objects; the class mutates those objects to do its work. Often, there are several classes that all hold a mutable reference to the same object. Here is a diagram that illustrates this: flowchart LR subgraph Shared functionality important[Important Shared Object] end subgraph ObjectA methodA[Method] refa[Mutable Reference]--&gt;important methodA-. Acts on shared object.-&gt;important end subgraph ObjectB refb[Mutable Reference]--&gt;important methodB[Method] methodB-. Acts on shared object.-&gt;important end main --&gt; ObjectA main --&gt; ObjectB main-. Calls .-&gt; methodA main-. Calls .-&gt; methodB In Rust, you can't have multiple mutable references to a shared object, so what do you do? First of all, consider moving behavior out of your types. (See the answer about the observer pattern and especially the second option described there .) Even in Rust, though, it's still often the best choice to make complex behavior part of the type within impl blocks. You can still do that - but don't store references. Instead, pass them into each function call. flowchart LR subgraph Shared functionality important[Important Shared Object] end subgraph ObjectA methodA[Method] methodA-. Acts on shared object.-&gt;important end subgraph ObjectB methodB[Method] methodB-. Acts on shared object.-&gt;important end main --&gt; ObjectA main --&gt; ObjectB main --&gt; important main-. Passes reference to shared object.-&gt; methodA main-. Passes reference to shared object.-&gt; methodB Instead of this: # struct ImportantSharedObject;
# struct ObjectA<'a> {
# important_shared_object: &'a mut ImportantSharedObject,
# }
# impl<'a> ObjectA<'a> {
# fn new(important_shared_object: &'a mut ImportantSharedObject) -> Self {
# Self {
# important_shared_object
# }
# }
# fn do_something(&mut self) {
# // act on self.important_shared_object
# }
# }
fn main() { let mut shared_thingy = ImportantSharedObject; let mut a = ObjectA::new(&mut shared_thingy); a.do_something(); // acts on shared_thingy
} Do this: # struct ImportantSharedObject;
# struct ObjectA;
# impl ObjectA {
# fn new() -> Self {
# Self
# }
# fn do_something(&mut self, important_shared_object: &mut ImportantSharedObject) {
# // act on important_shared_object
# }
# }
fn main() { let mut shared_thingy = ImportantSharedObject; let mut a = ObjectA::new(); a.do_something(&mut shared_thingy); // acts on shared_thingy
} (Happily this also gets rid of named lifetime parameters.) If you have a hundred such shared objects, you probably don't want a hundred function parameters. So it's usual to bundle them up into a context structure which can be passed into each function call: # struct ImportantSharedObject;
# struct AnotherImportantObject;
struct Ctx<'a> { important_shared_object: &'a mut ImportantSharedObject, another_important_object: &'a mut AnotherImportantObject,
} # struct ObjectA;
# impl ObjectA {
# fn new() -> Self {
# Self
# }
# fn do_something(&mut self, ctx: &mut Ctx) {
# // act on ctx.important_shared_object and ctx.another_important_thing
# }
# }
fn main() { let mut shared_thingy = ImportantSharedObject; let mut another_thingy = AnotherImportantObject; let mut ctx = Ctx { important_shared_object: &mut shared_thingy, another_important_object: &mut another_thingy, }; let mut a = ObjectA::new(); a.do_something(&mut ctx); // acts on both the shared thingies
} flowchart LR subgraph Shared functionality important[Important Shared Object] end subgraph Context refa[Mutable Reference]--&gt;important end subgraph ObjectA objectA[Object A] methodA[Method] methodA-. Acts on shared object.-&gt;important end subgraph ObjectB objectB[Object B] methodB[Method] methodB-. Acts on shared object.-&gt;important end main --&gt; objectA main --&gt; objectB main --&gt; Context main-. Passes context.-&gt; methodA main-. Passes context.-&gt; methodB Even simpler: just put all the data directly into Ctx. But the key point is that this context object is passed around into just about all function calls rather than being stored anywhere, thus negating any borrowing/lifetime concerns. This pattern can be seen in bindgen , for example. Split out borrowing concerns from the object concerns. - MG To generalize this idea, try to avoid storing references to anything that might need to be changed. Instead take those things as parameters. For instance petgraph takes the entire graph as context to a Walker object , such that the graph can be changed while you're walking it.

