In Rust, it's common to reuse the same name for multiple variables in a function. For a C++ programmer, this is weird, but there are two good reasons to do it: You may no longer need to change a mutable variable after a certain point, and if your code is sufficiently complex you might want the compiler to guarantee this for you: # fn spot_ate_my_slippers() -> bool {
# false
# }
# fn feed(_: &str) {}
let mut good_boy = "Spot";
if spot_ate_my_slippers() { good_boy = "Rover";
}
let good_boy = good_boy; // never going to change my dog again, who's a good boy
feed(&good_boy); Another common pattern is to retain the same variable name as you gradually unwrap things to a simpler type: # let url = "http://foo.com:1234";
let port_number = url.split(":").skip(2).next().unwrap(); // hmm, maybe somebody else already wrote a better URL parser....? naah, probably not
let port_number = port_number.parse::<u16>().unwrap();

