# let s = "0x64a";
if s.starts_with("0x") { u64::from_str_radix(s.strip_prefix("0x").unwrap(), 16)
} else { s.parse::<u64>()
}
# } and no extra unwrap() here: # fn test_parse() -> Result<u64,std::num::ParseIntError> {
# let s = "0x64a";
match s.strip_prefix("0x") { None => s.parse::<u64>(), Some(remainder) => u64::from_str_radix(remainder, 16),
}
# } if let and matches! are just as good as match but sometimes a little more concise. cargo clippy will usually tell you if you're using a match which can be simplified to one of those other two constructions.
